import React from 'react'

import {
    Col, Card, CardTitle, CardText, Button
} from 'reactstrap'

const NoteCard = () => {
    return (

        <Col sm={6}>
            <Card>
                <CardTitle>Not Başlığı</CardTitle>
                <CardText>Not İçeriği</CardText>
                <Button color="primary">Düzenle</Button>
                <Button color="danger">Sil</Button>
            </Card>
        </Col>
    )
}

export default NoteCard
